import { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

function SendEmail() {
  const [subject, setSubject] = useState("");
  const [message, setMessage] = useState("");
  const [status, setStatus] = useState({ type: "", text: "" });
  const navigate = useNavigate();
  const recipientEmail = "group.nmc@psn.co.id";

  useEffect(() => {
    if (!localStorage.getItem("email") || !localStorage.getItem("password")) {
      navigate("/");
    }
  }, [navigate]);

  const handleSendEmail = async (e) => {
    e.preventDefault();
    try {
      const email = localStorage.getItem("email");
      const password = localStorage.getItem("password");

      await axios.post("http://192.168.1.13:4000/send-email", {
        email,
        password,
        to: recipientEmail,
        subject,
        message,
      });

      setSubject("");
      setMessage("");
      setStatus({ type: "success", text: "✅ Email sent successfully!" });
      setTimeout(() => setStatus({ type: "", text: "" }), 3000);
    } catch (err) {
      setStatus({ type: "error", text: "❌ Failed to send email. Please try again." });
      console.error("Email sending error:", err);
    }
  };

  return (
    <div
      className="min-vh-100 vw-100 d-flex justify-content-center align-items-center"
      style={{ background: "linear-gradient(to bottom, #222, #444)", minHeight: "100vh" }}
    >
      <div
        className="p-5 shadow-lg d-flex flex-column align-items-center w-100"
        style={{ borderRadius: "10px", backgroundColor: "#333", color: "white", minHeight: "80vh", maxWidth: "600px" }}
      >
        <div className="text-center mb-3">
          <img src="/logonmc1.png" alt="Logo" style={{ width: "180px", borderRadius: "10px" }} />
        </div>
        <h2 className="text-center" style={{ fontWeight: "bold" }}>Halo NMC Team!</h2>
        <p className="text-center text-light">Silakan submit daily activity kamu sebelum pulang</p>

        {status.text && (
          <div className={`alert ${status.type === "success" ? "alert-success" : "alert-danger"} text-center w-100`}>
            {status.text}
          </div>
        )}

        <form onSubmit={handleSendEmail} className="w-100">
          <div className="mb-3">
            <label className="form-label fw-bold text-light">Recipient Email</label>
            <input type="email" className="form-control bg-dark text-light border-0" value={recipientEmail} readOnly />
          </div>
          <div className="mb-3">
            <label className="form-label fw-bold text-light">Subject</label>
            <input
              type="text"
              className="form-control bg-dark text-light border-0"
              placeholder="Enter email subject"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label fw-bold text-light">Detail</label>
            <textarea
              className="form-control bg-dark text-light border-0"
              placeholder="Input your daily activity"
              value={message}
              onChange={(e) => setMessage(e.target.value)}
              required
              rows="5"
            ></textarea>
          </div>
          <button 
            type="submit" 
            className="btn w-100 text-white" 
            disabled={!subject || !message}
            style={{ backgroundColor: "#3498db", fontWeight: "bold", borderRadius: "5px", padding: "10px" }}
          >
            Submit
          </button>
        </form>

        <button 
          className="btn btn-danger w-50 mt-3" 
          onClick={() => navigate("/logout")}
          style={{ fontWeight: "bold", borderRadius: "5px", padding: "10px" }}
        >
          Logout
        </button>
      </div>
    </div>
  );
}

export default SendEmail;
